import React from 'react'
import './Bmain.css';
import Cancel from './Cancel';
import Start from './Start';
import HeaderSub from '../HeaderSub';


 function Bmain() {
  return (
    <div>
      <HeaderSub/>
      <Start/>
      <Cancel/>
    </div>
  );
}
export default Bmain;
